description:
Ce Lumix DMC-FS35 à objectif intégré accueille un zoom optique de 4 x, avec une distance focale de 28-224 mm. Le cadrage des clichés s'effectue sur l'écran LiveView de format 2.7 pouces, en qualité 16Mp.

Le Lumix DMC-FS35 ne pèse que 159 g pour des dimensions réduites de 57 x 99 x 28 mm. Il possède un stabilisateur de type optique.

Vendu avec :
- Boite d'origine (notice et CD d'installation) ;
- Housse de transport ;
- Chargeur ;
- Câble TV ;
- Câble ordinateur ;
- Carte SD de 4Go pour débuter.

Prêt à l'emploi.

Envoi bien emballé et soigné possible.
